/*Table structure for table `weather` */

DROP TABLE IF EXISTS `weather`;

CREATE TABLE `weather` (
  `w_id` int(128) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `date` varchar(128) DEFAULT NULL COMMENT '日期时间',
  `w_buoyid` varchar(128) DEFAULT NULL COMMENT '浮标id',
  `w_airpre` varchar(128) DEFAULT NULL COMMENT '气压',
  `w_airtemp` varchar(128) DEFAULT NULL COMMENT '气温',
  `w_wattemp` varchar(128) DEFAULT NULL COMMENT '水温',
  `w_hatchtemp` varchar(128) DEFAULT NULL COMMENT '舱温',
  `w_oppohumi` varchar(128) DEFAULT NULL COMMENT '相对湿度',
  `v_visipulu` varchar(128) DEFAULT NULL COMMENT '能见度污染',
  `w_visibili` varchar(128) DEFAULT NULL COMMENT '能见度',
  `w_rain` varchar(128) DEFAULT NULL COMMENT '雨量',
  `w_rain_hour` varchar(128) DEFAULT NULL COMMENT '小时雨量',
  `w_total_rad` varchar(128) DEFAULT NULL COMMENT '总辐射',
  `w_red_rad` varchar(128) DEFAULT NULL COMMENT '红外辐射',
  `w_sun` varchar(128) DEFAULT NULL COMMENT '日照时长',
  `w_dataid` varchar(128) DEFAULT NULL COMMENT '数据id',
  `w_rain_measure` varchar(128) DEFAULT NULL COMMENT '雨量测量',
  `w_before_rm` varchar(128) DEFAULT NULL COMMENT '雨量测量前',
  `w_short_rad` varchar(128) DEFAULT NULL COMMENT '短波辐射',
  `w_co2` varchar(128) DEFAULT NULL COMMENT '空气co2',
  `w_sun_rad` varchar(128) DEFAULT NULL COMMENT '日照辐射',
  PRIMARY KEY (`w_id`),
  KEY `date` (`date`,`w_buoyid`)
) ENGINE=InnoDB AUTO_INCREMENT=1111 DEFAULT CHARSET=utf8;

