/*Table structure for table `wind` */

DROP TABLE IF EXISTS `wind`;

CREATE TABLE `wind` (
  `wind_id` int(128) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `date` varchar(128) DEFAULT NULL COMMENT '日期时间',
  `wind_buoyid` varchar(128) DEFAULT NULL COMMENT '浮标号',
  `wind_speed_max` varchar(128) DEFAULT NULL COMMENT '最大风速',
  `wind_speed_maxto` varchar(128) DEFAULT NULL COMMENT '最大风速风向',
  `wind_speed_maxtime` varchar(128) DEFAULT NULL COMMENT '最大风速时间',
  `wind_speed_ji` varchar(128) DEFAULT NULL COMMENT '极大风速',
  `wind_speed_jito` varchar(128) DEFAULT NULL COMMENT '极大风速风向',
  `wind_speed_jitime` varchar(128) DEFAULT NULL COMMENT '极大风速时间',
  `wind_speed_ten` varchar(128) DEFAULT NULL COMMENT '十分钟平均风速',
  `wind_speed_tento` varchar(128) DEFAULT NULL COMMENT '十分钟平均风向',
  `wind_speed_instant` varchar(128) DEFAULT NULL COMMENT '瞬时风速',
  `wind_to_instant` varchar(128) DEFAULT NULL COMMENT '瞬时风向',
  PRIMARY KEY (`wind_id`),
  KEY `date` (`date`,`wind_buoyid`)
) ENGINE=InnoDB AUTO_INCREMENT=989 DEFAULT CHARSET=utf8;

